import styled from "styled-components";

export const Wrapper = styled.div`
    background-color: #242736;
`;

export const Context = styled.div`

    ul{
        list-style-type: none;
        margin: 0px;
        padding: 11px;
        font-size: 18px;
        /* text-align: center; */
        font-weight: inherit;
        height: auto;

        li{
            display: inline-block;
            min-width: 5em;
            margin: 0 0.5em;
            color: white;

            a{
                text-decoration: none;
                display: block;
                font-family: Arial;
                position: relative;
                padding: .5em 0;

            }
        }
    }
`;
